import React from 'react';
import { Container, Box, Typography, TextField, Button, Stack } from '@mui/material';
import { purple } from '@mui/material/colors';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

const LoginPage = () => {
  return (
    <Container maxWidth="sm">
      <Box
        sx={{
          minHeight: '100vh',
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          backgroundColor: purple[50],
        }}
      >
        <AccountCircleIcon sx={{ fontSize: 100, color: purple[900] }} />
        <Typography variant="h4" sx={{ fontWeight: 'bold', color: purple[900], mb: 2 }}>
          Sneak-Check
        </Typography>
        <Typography variant="h6" sx={{ color: purple[800], mb: 3 }}>
          Log in with your wallet address
        </Typography>
        <TextField
          label="Wallet Address"
          placeholder="Enter your wallet address"
          fullWidth
          variant="outlined"
          sx={{ mb: 2 }}
        />
        <Stack direction="row" spacing={2} fullWidth>
          <Button
            variant="contained"
            color="secondary"
            sx={{ backgroundColor: purple[700], fontWeight: 'bold' }}
            fullWidth
          >
            Log in as User
          </Button>
          <Button
            variant="contained"
            color="secondary"
            sx={{ backgroundColor: purple[900], fontWeight: 'bold' }}
            fullWidth
          >
            Log in as Company
          </Button>
        </Stack>
      </Box>
    </Container>
  );
};

export default LoginPage;
